import { useState } from 'react';


function App() {
  const [counter, setCounter] = useState(0);

  // update counter every second 
  setTimeout(() => {
    setCounter(counter + 1);
  }, 1000);

  return (
    <p>Counter: {counter}</p>
  );
}

export default App;
